import Formbox from './Formbox';
import Databox from './Databox';

function App() {
  return (
    <div className="container">
      <div className="header"><h5>Header</h5></div>

      <div className="content">
        <Formbox />
        <Databox />
      </div>

      <div className="footer"><h5>Footer</h5></div>
    </div>
  );
}

export default App;
